  //       <DropdownItem style={{backgroundColor:'indianred'}} link="links.html">BLM Links</DropdownItem>
  //     </Dropdown>
  //   )
  // }

  // if i get desperate and want to use bootstrap: https://stackoverflow.com/questions/43493678/react-bootstrap-import-navbar-module

  render() {
    let linksUL = (
      <ul className="mui-dropdown__menu mui--is-open" style={{top: '39.5px'}}>
        <li style={{backgroundColor: 'indianred'}}><a href="links.html">My Links</a></li>
        <li style={{backgroundColor: 'indianred'}}><a href="links.html">BLM Links</a></li>
      </ul>
    );

    let fakeUL = (
      <ul className="mui-dropdown__menu mui--is-open" style={{top: '39.5px'}}>
        <li style={{backgroundColor: 'indianred'}}><a href="links.html">F1</a></li>
        <li style={{backgroundColor: 'indianred'}}><a href="links.html">F2</a></li>
      </ul>
    );

    return (
      <div id="navbar-container">
        <div id="navbar-title-container">
          <Typography id="navbar-title" variant="h2">
            NATALIE WAGNER
          </Typography>
        </div>
        <div id="navbar-buttons-container">
          <Button color="inherit" onClick={() => this.navigateTo('index.html')}
            onMouseEnter={() => console.log('enter home')}
            onMouseLeave={() => console.log('exit home')}>
            Home
          </Button>

          {/* <Button color="inherit" onClick={() => this.navigateTo('quiz.html')}>
            Quiz
          </Button> */}
          <Button color="inherit" onClick={() => this.navigateTo('links.html')}>
            My Links
          </Button>

          <Button color="inherit" onClick={() => this.navigateTo('emailnatalie.html')}>
            Email Me
          </Button>

          {/* break */}

          <Button color="inherit" className="navbar-dropdown" onClick={() => {}}
            onMouseEnter={() => {
              ReactDOM.render(linksUL, document.getElementById('navbar-secondary'));
            }}>
            Links
          </Button>

          <Button color="inherit" className="navbar-dropdown" onClick={() => {}}
            onMouseEnter={() => {
              ReactDOM.render(fakeUL, document.getElementById('navbar-secondary'));
            }}>
            Fake
          </Button>

          <div id="navbar-secondary"
            className="navbar-dropdown mui-dropdown MuiButtonBase-root MuiButton-root MuiButton-text MuiButton-colorInherit"
            style={{display: 'inline', borderWidth: '0px'}}>
          </div>

          {/* {this.createDropdown({
            id: 'links-dd',
            label: 'LINKS',
            links: ['links.html', 'links.html'],
            linkLabels: ['My Links', 'BLM Links'],
          })} */}

          {/* <Dropdown
            id="links-dropdown"
            onMouseEnter={() => this.toggleDropdown('links-dropdown')}
            // onMouseLeave={() => this.toggleDropdown('links-dropdown')}
            color="inherit" style={{display:'inline', borderWidth:'0px'}} label="LINKS" className="MuiButtonBase-root MuiButton-root MuiButton-text MuiButton-colorInherit">
            <DropdownItem style={{backgroundColor:'indianred'}} link="links.html">My Links</DropdownItem>
            <DropdownItem style={{backgroundColor:'indianred'}} link="links.html">BLM Links</DropdownItem>
          </Dropdown> */}
        </div>
      </div>
    );
  }
}

export default Navbar;
